import React from 'react';
import { Alert, AlertIcon, AlertTitle, AlertDescription, CloseButton } from '@chakra-ui/react';

export const emailTakenAlert = () => {
    return (
        <Alert status="error">
            <AlertIcon />
            <AlertTitle mr={2}>Email taken</AlertTitle>
            <AlertDescription>The email is already taken</AlertDescription>
            <CloseButton position="absolute" right="6px" top="8px"/>
        </Alert>
    );
}
